import React from "react";
import "./style.css";

function UserCard(props) {
  return (
    <div>
        <p><strong>Name:</strong> {props.name.first} {props.name.last}</p>
        <p><strong>State:</strong> {props.location.state}</p>
        <p><strong>Gender:</strong> {props.gender}</p>
    </div>
  );
}

export default UserCard;
